using System;
using Microsoft.VisualStudio.TestTools.UnitTesting;

namespace Leecodeoj.unititest
{
    [TestClass]
    public class WildcardMatching_unittest
    {

        private void isMatch(String textString, String pattern, bool expectedResult)
        {
            bool actualResult = WildcardMatching.IsMatch(textString, pattern);
            Assert.AreEqual(actualResult, expectedResult);
        }

        [TestMethod]
        public void isMatch_TestCaseLong()
        {
            isMatch("",
                    "**",
                    false);
        }

        [TestMethod]
        public void isMatch_cababAndStart()
        {
            isMatch("cabab", "*ab", true);
        }

        [TestMethod]
        public void isMatch_Startaa()
        {
            isMatch("aa", "*a", true);
        }

        [TestMethod]
        public void isMatch_Starta()
        {
            isMatch("ab", "*a", false);
        }

        [TestMethod]
        public void isMatch_Case1()
        {
            isMatch("hi", "*?", true);
        }

        [TestMethod]
        public void isMatch_EndWithStart()
        {
            isMatch("cab", "*ab", true);
        }

        [TestMethod]
        public void isMatch_cStartQStart()
        {
            isMatch("c", "*?*", true);
        }

        [TestMethod]
        public void isMatch_bAndDoubleQuestionMark()
        {
            isMatch("b", "?*?", false);
        }

        [TestMethod]
        public void isMatch_aaAnda()
        {
            isMatch("aa", "a", false);
        }

        [TestMethod]
        public void isMatch_EmptyWithWildCard()
        {
            isMatch("", "*", true);
        }

        [TestMethod]
        public void isMatch_SameSizeWithQuestionMark()
        {
            isMatch("b", "?", true);
        }

        [TestMethod]
        public void isMatch_aAndaStart()
        {
            isMatch("a", "a*", true);
        }

        [TestMethod]
        public void isMatch_differentLength()
        {
            isMatch("aa", "a", false);
        }

        [TestMethod]
        public void isMatch_sameString()
        {
            isMatch("aa", "aa", true);
        }

        [TestMethod]
        public void isMatch_differentLength2()
        {
            isMatch("aaa", "aa", false);
        }

        [TestMethod]
        public void isMatch_EndWithWildCard()
        {
            isMatch("aa", "a*", true);
        }

        [TestMethod]
        public void isMatch_CompareWithWildCard()
        {
            isMatch("aa", "*", true);
        }

        [TestMethod]
        public void isMatch_SameLengthAndEndWithWildCard()
        {
            isMatch("aa", "?*", true);
        }

        [TestMethod]
        public void isMatch_MoreCharacterAndWithWildCard()
        {
            isMatch("aab", "c*a*b", false);
        }

        [TestMethod]
        public void isMatch_MoreCharacterAndEndWithWildCard()
        {
            isMatch("aab", "c*a*b*", false);
        }
        [TestMethod]
        public void isMatch_MoreCharacter()
        {
            isMatch("abc", "a*b*c*", true);
        }
        [TestMethod]
        public void isMatch_MoreCharacter1()
        {
            isMatch("abc", "a*b*c**", true);
        }
        [TestMethod]
        public void isMatch_MoreCharacter2()
        {
            isMatch("abffc", "a*b*c", true);
        }

        [TestMethod]
        public void isMatch_MoreCharacter4()
        {
            isMatch("aabbcasdf32cc", "*a*b*c?", true);
        }
    }
}
